# startPlayback

**Instance Property**

The app intent conforms to the schema for starting a presentation.

## Declaration

```swift
var startPlayback: some AssistantSchemas.Intent { get }
```

## Overview

Use Swift macros that generate additional properties and add protocol conformance for your app intent implementation. The following example shows an app intent that conforms to the `.presentation.startPlayback` schema:

```swift
@AppIntent(schema: .presentation.startPlayback)
struct StartPlaybackPresentationIntent: AppIntent {
    @Parameter
    var presentation: PresentationEntity

    @Parameter
    var target: PresentationSlideEntity?

    func perform() async throws -> some IntentResult {
        .result()
    }
}
```

For more information about the `.presentation` app intent domain, see [doc://com.apple.AppIntents/documentation/AppIntents/Making-presentation-actions-available-to-siri-and-apple-intelligence]. For general information about app intent domains, see [doc://com.apple.AppIntents/documentation/AppIntents/Integrating-actions-with-siri-and-apple-intelligence].
